import React, { useEffect, useState } from "react";
import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import OnSale from "./components/onSale"
import { observer, inject } from "mobx-react"
import AgentSale from "./components/agentSale"
import "./style.scss"
import { toFixed } from "@utils/numberUtils";
const Consignment = (props: any) => {
  const [check, setCheck] = useState(1)
  const { goBack, push } = useHistory();
  const { homeState, banksState } = props;
  const { data } = homeState;
  const { mapBanks } = banksState;
  useEffect(() => {

  }, [])
  const goConsignment = () => {
    push("/consignmentRecord")
  }
  return (
    <div className="consignment-wrap">
      <HeaderBar goback={goBack} title={"代售"} rightTitle={"代售记录"} cb={goConsignment} />
      <div className="consignment-top">
        <div className="consignment-coin">
          <p className="consignment-item">
            <span className="qb-text">Q币库存</span>
            <span className="qb-number">
              <i></i>
              {toFixed(data.coinAmount)}
            </span>
          </p>
          <p className="consignment-item">
            <span className="qb-text  font-32">今日收益</span>
            <span className="qb-number font-32">
              <i></i>
              {toFixed(data.todayIncome)}
            </span>
          </p>
          <p className="consignment-item">
            <span className="qb-text font-24">在售额度</span>
            <span className="qb-number font-24">
              {toFixed(data.saleAmount)}
            </span>
          </p>
        </div>
      </div>
      <div className="consignment-tabs">
        <p className={check === 1 ? "consignments-a check" : "consignments-a"} onClick={() => setCheck(1)}>在售列表</p>
        <p className={check === 2 ? "consignments-b check" : "consignments-b"} onClick={() => setCheck(2)} >代售列表</p>
      </div>
      {check === 1 && <OnSale />}
      {check === 2 && <AgentSale banks={mapBanks}/>}
    </div >
  )
}
export default inject('homeState', 'banksState')((observer(Consignment)));
